import React from "react";
import { Link } from 'react-router-dom';

const SalesAndPurchasesTable = ({label, items, link, type}) => {
    const personLabel = type === 'sales' ? "Dodavatel" : "Odberatel";
    return (
        
        <div>
            <p>
               <h2> {label} faktury </h2> 
            </p>
        <table>    
            <thead>
                <tr>                    
                    <th>Cislo faktury</th>
                    <th>{personLabel}</th>
                    <th>Cena</th>
                    <th>Datum vystaveni</th>
                    <th>Datum splatnosti</th>
                </tr>
            </thead>
            <tbody>
                {items.map(item => (
                    <tr key={item.identificationNumber}>
                        <td>{item.invoiceNumber}</td>
                        <td>{link ? <Link to={`${link}/${item._id}`}>{type === 'sales' ? item.seller.name : item.buyer.name}</Link> : (type === 'sales' ? item.seller.name : item.buyer.name)}</td>
                        <td>{item.price}</td>
                            <td>{new Date(item.issued).toLocaleDateString()}</td>
                            <td>{new Date(item.dueDate).toLocaleDateString()}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>

    );
}

export default SalesAndPurchasesTable;
